import logo from './logo.svg';
import './App.css';
import ListQuotes from './js/listquotes';
import InsertWriter from './js/insertwriter';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
 /*   <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>*/
    <Router>

        <div className="main">
          <div>
            <ListQuotes />
            <Routes>
              <Route exact path='/insertwriter' component={InsertWriter} />
              <Route exact path='/' component={ListQuotes} />             
            </Routes>
          </div>
        </div>  
      </Router>
  );
}

//ReactDOM.render(<App />, document.getElementById('monapp'));


export default App;
